    false,nt"url": null,nt"notes": "This dataset contains case counts of asthma
    inpatient hospitalizations among Iowa residents. These include incidents of asthma
    attacks, obstructive lung disease, and reactive airway disease. The data are stratified
    by county of residence, age group, and gender.  The data contained in this dataset
    is collected by the Iowa Hospital Association on behalf of the Iowa Department of
    Public Health in accordance with Iowa Code section 135.166. This dataset contains
    confidential information. Small numbers suppression has been applied to data available
    to the public. The hospital admissions data present state hospital discharge data
    which reflects more severe exacerbations of asthma. Persons who have to stay in
    the hospital because of asthma usually have more severe attacks than persons with
    asthma symptoms who are not hospitalized. This dataset is using hospital admission
    dates while other public health programs use the hospital discharge dates to count
    asthma cases. This may cause a difference in asthma rates between this dataset and
    other public health Web sites.",nt"license_title": "License Not Specified",nt"extras":
